import {React} from 'react';
import logo from '../logo.png';

function Navbar() {
    return (
        <nav>
           <img src={logo} alt="logo"/> 
           <div class="empty"></div>
           <div className="buttons-holder">
               <button>Home</button>
               <button>Graph</button>
               <button>Predict</button>
           </div>
        </nav>
    )
}

export default Navbar;
